import styled from "styled-components";

const Header__upper = styled.div`
  display: flex;
  justify-content: center;
`;

const MainLogo = styled.img`
  width: 20px;
  height: 20px;
`;

function Header() {
  return (
    <Header__upper>
      <MainLogo src="../img/new_logo_nobackground.png" />
    </Header__upper>
  );
}

export default Header;
